import java.util.*;
public class DoWhileEvenNum {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		  int i;
       System.out.println("enter number");
       Scanner sc=new Scanner(System.in);
       int n=sc.nextInt();   
       i=1;
          while(i<=n)

          {

                      System.out.println(i);

                      i+=2;

          }
	}

}
